import React, { useEffect, useState, useRef } from "react";
import { MapContainer, TileLayer, Polyline, Marker, useMap } from "react-leaflet";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import "./App.css";

// Custom Icons
const busIcon = L.icon({
  iconUrl: "https://cdn-icons-png.flaticon.com/512/2967/2967350.png",
  iconSize: [40, 40],
  iconAnchor: [20, 20],
});

const userIcon = L.icon({
  iconUrl: "https://cdn-icons-png.flaticon.com/512/64/64113.png",
  iconSize: [35, 35],
  iconAnchor: [17, 17],
});

// Route: Dehradun → Delhi
const routeCoords = [
  [30.3165, 78.0322], // Dehradun
  [29.8661, 77.8945], // Roorkee
  [29.4727, 77.7085], // Muzaffarnagar
  [29.2100, 77.0400], // Meerut
  [28.6139, 77.2090], // Delhi
];

function MoveMapToBus({ busPosition }) {
  const map = useMap();
  useEffect(() => {
    if (busPosition) map.panTo(busPosition);
  }, [busPosition, map]);
  return null;
}

function App() {
  const [busIndex, setBusIndex] = useState(0);
  const [busPos, setBusPos] = useState(routeCoords[0]);
  const [userPos, setUserPos] = useState(null);
  const [distance, setDistance] = useState(null);
  const [status, setStatus] = useState("Waiting...");
  const intervalRef = useRef(null);

  // Get user location once
  useEffect(() => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (pos) => setUserPos([pos.coords.latitude, pos.coords.longitude]),
        () => setUserPos([28.6139, 77.2090]) // fallback Delhi
      );
    }
  }, []);

  // Haversine formula for distance
  const calcDistance = (a, b) => {
    const toRad = (x) => (x * Math.PI) / 180;
    const R = 6371;
    const dLat = toRad(b[0] - a[0]);
    const dLon = toRad(b[1] - a[1]);
    const lat1 = toRad(a[0]);
    const lat2 = toRad(b[0]);
    const val =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(lat1) * Math.cos(lat2) * Math.sin(dLon / 2) ** 2;
    return R * 2 * Math.atan2(Math.sqrt(val), Math.sqrt(1 - val));
  };

  const startTracking = () => {
    setStatus("🟢 Running");
    let index = busIndex;
    intervalRef.current = setInterval(() => {
      if (index < routeCoords.length - 1) {
        index++;
        const newPos = routeCoords[index];
        setBusPos(newPos);
        setBusIndex(index);
        if (userPos) {
          const dist = calcDistance(userPos, newPos);
          setDistance(dist.toFixed(2));
        }
      } else {
        clearInterval(intervalRef.current);
        setStatus("🏁 Reached Delhi");
      }
    }, 5000);
  };

  const stopTracking = () => {
    clearInterval(intervalRef.current);
    setStatus("⛔ Stopped");
  };

  return (
    <div className="app">
      <div className="sidebar">
        <h2>🚌 SmartBus Live Tracker</h2>
        <p><b>Route:</b> Dehradun → Delhi</p>
        <p><b>Status:</b> {status}</p>
        <p><b>Distance to you:</b> {distance ? `${distance} km` : "--"}</p>
        <div className="buttons">
          <button onClick={startTracking}>Start Tracking</button>
          <button onClick={stopTracking}>Stop</button>
        </div>
      </div>

      <MapContainer
        center={routeCoords[0]}
        zoom={7}
        style={{ height: "100vh", width: "100%" }}
      >
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
        <Polyline positions={routeCoords} color="cyan" />
        <Marker position={busPos} icon={busIcon}></Marker>
        {userPos && <Marker position={userPos} icon={userIcon}></Marker>}
        <MoveMapToBus busPosition={busPos} />
      </MapContainer>
    </div>
  );
}

export default App;
